{
  "reasoning": "The character Ashley Williams is seen performing an unnatural and erratic movement pattern, including floating and sliding sideways up the stairs, which is inconsistent with normal character animations and physics. This behavior suggests a physics or animation glitch causing the character to move in an unintended manner.",
  "bug_report_title": "Character Ashley Williams exhibits floating and sliding animation glitch on stairs",
  "bug_report_description": "Ashley Williams, a companion character, is observed floating and sliding sideways up a staircase instead of walking normally. The character's legs do not appear to be making proper contact with the stairs, and the movement is jerky and unnatural. This glitch could disrupt immersion and potentially interfere with gameplay if the character is required to follow or interact in this area.",
  "affected_item": "Character animation and physics"
}

{
  "reasoning": "The video shows a helicopter carrying a character who is suspended in mid-air. The character appears to be hanging unnaturally and is not interacting with the helicopter's physics or animations correctly. The character's position remains fixed relative to the helicopter, and there is no visible rope or harness connecting them, which is inconsistent with expected game behavior. This suggests a physics or animation glitch where the character is not properly attached or rendered during the helicopter transport sequence.",
  "bug_report_title": "Character Hanging Mid-Air Without Proper Attachment to Helicopter",
  "bug_report_description": "During a helicopter transport sequence, the character being carried is suspended in mid-air without any visible connection to the helicopter. The character's position does not change relative to the helicopter, and there is no rope or harness visible, indicating a physics or animation bug. This visual glitch breaks immersion and may confuse players about the state of the character or the transport mechanic. It could also potentially affect gameplay if the character's state is not properly tracked during this sequence.",
  "affected_item": "Character physics and animation"
}

{
  "reasoning": "The video shows a player character standing on top of a helicopter in mid-air, which is an unusual and unintended behavior in most games. Characters are typically expected to be inside vehicles or on the ground, not on the exterior surfaces while the vehicle is flying. This suggests a physics or collision detection glitch allowing the player to stand on the helicopter's roof.",
  "bug_report_title": "Player Character Standing on Helicopter Exterior in Mid-Air",
  "bug_report_description": "The player character is able to stand on the roof of a flying helicopter, which is not a normal or intended behavior. This likely results from a collision detection or physics bug that fails to restrict player movement to inside the vehicle or on the ground. This glitch can break immersion and potentially be exploited for unintended gameplay advantages, such as avoiding damage or gaining unusual vantage points.",
  "affected_item": "Character physics and vehicle collision detection"
}

{
  "reasoning": "The video shows a helicopter stuck in the environment, unable to move or respond to player input, followed by the player character being unable to interact properly with the helicopter or the environment. The helicopter appears to be clipped into the terrain or an object, and the player is stuck in a limited area with no clear way to proceed. This is indicative of a physics or collision detection glitch.",
  "bug_report_title": "Helicopter stuck in terrain causing player entrapment and interaction issues",
  "bug_report_description": "The helicopter becomes stuck in the terrain or an object near the network station, preventing it from moving or being used properly. The player character is unable to exit or interact with the helicopter normally, and is trapped in a confined area with limited movement options. This glitch disrupts gameplay by blocking player progression and vehicle usage, potentially requiring a reload or restart to resolve.",
  "affected_item": "Physics and collision detection involving helicopter and environment"
}

{
  "reasoning": "The video shows the player character Geralt in The Witcher 3 standing on a boat that is floating on water. However, the water surface is completely static and lacks any realistic wave or ripple animation, even when the boat moves or Geralt jumps into the water. Additionally, the boat does not react physically to Geralt's movements or the water environment, and the water surface appears to be a flat, repeating texture rather than a dynamic fluid simulation. This lack of water physics and animation breaks immersion and realism.",
  "bug_report_title": "Static Water Surface and Non-Responsive Boat Physics",
  "bug_report_description": "In the game, the water surface remains completely static and does not show any wave or ripple effects when the boat moves or the player interacts with the water. The boat does not physically respond to Geralt's movements or the water environment, appearing to float unnaturally on a flat, repeating water texture. This graphical and physics anomaly reduces immersion and may confuse players expecting realistic water behavior and boat physics.",
  "affected_item": "Environment (Water Surface) and Physics (Boat and Water Interaction)"
}

{
    "reasoning": "The video shows an enemy character (a wolf) floating in mid-air without any visible support or ground contact, which is not a natural behavior for this type of NPC. The player character is aiming and shooting arrows at the floating enemy, indicating that the enemy is still interactable despite the abnormal positioning.",
    "bug_report_title": "Enemy NPC Floating Mid-Air Instead of Standing on Ground",
    "bug_report_description": "During gameplay, an enemy wolf NPC is observed floating in mid-air among trees instead of standing on the ground as expected. This visual glitch breaks immersion and may affect combat dynamics, as the enemy's position is unnatural and could potentially interfere with hit detection or player targeting. The issue persists while the player aims and shoots arrows at the floating enemy.",
    "affected_item": "Character (Enemy NPC)"
}

{
  "reasoning": "The player character is seen climbing and jumping on the edge of a ship, but instead of properly landing or interacting with the ship's surface, the character clips through the ship's geometry and falls into the water below. This is followed by a 'Desynchronizacja' (Desynchronization) message, indicating a network or game state error. The clipping through the ship and falling through the environment is a clear physics and collision detection glitch.",
  "bug_report_title": "Player Character Clips Through Ship Geometry and Falls Into Water",
  "bug_report_description": "When the player character attempts to climb or jump on the edge of the ship, the character model clips through the ship's geometry instead of standing or landing on it. This causes the character to fall through the ship and into the water below, triggering a desynchronization error. This glitch disrupts gameplay by preventing normal navigation on the ship and may cause loss of progress or require a reload due to desynchronization.",
  "affected_item": "Physics and Collision Detection of Player Character and Ship Environment"
}

{
  "reasoning": "The images show a character model clipping through a wall or object, with the character's weapon and body partially embedded in the environment. This is evident from the unnatural positioning and partial invisibility of the character's model, which breaks immersion and can affect gameplay by obscuring vision or causing collision issues.",
  "bug_report_title": "Character Model Clipping Through Environment",
  "bug_report_description": "During combat, the player character or an NPC is seen clipping through a wall or object, with parts of the model and weapon intersecting the environment geometry. This visual glitch disrupts immersion and may cause gameplay issues such as obstructed view, inaccurate hit detection, or unintended cover mechanics. The clipping occurs consistently when the character is positioned near the edge of the environment structure.",
  "affected_item": "Character model and environment collision"
}

{
  "reasoning": "The images show a soccer match where the score is unusually high (17-0, then 18-0, and finally 19-0) which is highly unlikely in a normal game. This suggests a potential gameplay or AI issue where one team is overwhelmingly dominant without realistic opposition. Additionally, the player names and numbers appear normal, and the graphics and animations seem intact, so the issue is not graphical but related to game balance or AI behavior.",
  "bug_report_title": "Unrealistically High Score Due to AI or Gameplay Imbalance",
  "bug_report_description": "During the Ultimate Draft-Match, the score rapidly escalates to 19-0, which is an unrealistic and abnormal outcome for a soccer match. This indicates a potential bug in the AI difficulty, player behavior, or game mechanics that allows one team to dominate excessively without challenge. This imbalance can severely impact gameplay experience, making the match non-competitive and less enjoyable for players.",
  "affected_item": "Gameplay/AI"
}

{
  "reasoning": "The video shows a character performing a stealth kill on an enemy in a grassy environment. The enemy's outline remains visible after being killed, and the enemy's body disappears abruptly after the kill animation. Additionally, the enemy's health bar and alert status remain visible for a short time after death, which is inconsistent with normal behavior. This suggests a rendering or state update issue where the enemy's death state is not fully processed or visually updated immediately.",
  "bug_report_title": "Enemy Outline and UI Elements Persist After Death",
  "bug_report_description": "When the player performs a stealth kill on an enemy, the enemy's outline remains visible even after death, and the enemy's health bar and alert status icons persist briefly. The enemy's body also disappears abruptly instead of smoothly transitioning to a death state or ragdoll. This visual inconsistency can confuse players about whether the enemy is truly dead and may impact stealth gameplay by misleading the player about enemy awareness and status.",
  "affected_item": "Character (Enemy NPC) rendering and UI elements"
}

{
  "reasoning": "The video shows a character in a police uniform attempting to detain a suspect near a bus. However, the character's animation and physics behave abnormally, causing the character to float and spin in mid-air instead of performing a proper detainment or frisk animation. This is clearly a glitch as the character's body is not grounded and moves in an unnatural manner, which breaks immersion and could interfere with gameplay mechanics related to arrests.",
  "bug_report_title": "Floating and Spinning Animation Glitch During Suspect Detainment",
  "bug_report_description": "When the player character attempts to detain a suspect near a bus, the character's animation and physics malfunction, causing the character to float and spin uncontrollably in mid-air. This glitch prevents the proper execution of detainment and frisk animations, potentially disrupting gameplay flow and player experience during police interactions.",
  "affected_item": "Character animation and physics"
}

{
  "reasoning": "The video shows the player character standing on a rooftop ledge with a spider drone nearby. The drone appears to be stuck or hovering unnaturally close to the ledge, and the player character's movement is restricted by the ledge geometry. The drone's behavior and positioning seem unusual, as it does not move away or interact normally with the environment or the player. This suggests a potential AI pathfinding or collision detection issue with the spider drone near ledges.",
  "bug_report_title": "Spider Drone AI Pathfinding and Collision Issue Near Rooftop Ledge",
  "bug_report_description": "The spider drone gets stuck or hovers unnaturally close to the rooftop ledge, failing to move away or interact properly with the environment. This behavior restricts the drone's functionality and may impact gameplay by limiting the drone's effectiveness in combat or exploration near ledges. The issue appears to be related to AI pathfinding or collision detection when the drone is near rooftop edges.",
  "affected_item": "Spider Drone AI and Collision System"
}

{
  "reasoning": "The character's weapon appears to be clipping through their back and arm unnaturally, which is not consistent with normal weapon positioning. This visual inconsistency suggests a rendering or animation glitch.",
  "bug_report_title": "Weapon Clipping Through Character Model",
  "bug_report_description": "The character's weapon is visibly clipping through their back and arm, causing an unrealistic and immersion-breaking visual. This issue may distract players and reduce the overall visual quality of the game. It could also potentially interfere with hit detection or animations if the clipping affects collision models.",
  "affected_item": "Character model and weapon rendering"
}

{
  "reasoning": "The character model's arm detaches and floats unnaturally beside the character, then a second character appears with distorted limbs, indicating a physics or rigging error.",
  "bug_report_title": "Character Arm Detachment and Limb Distortion Glitch",
  "bug_report_description": "During gameplay, the main character's arm detaches and floats beside them instead of remaining attached. Subsequently, another character appears with limbs that are unnaturally bent and distorted, suggesting a physics or rigging malfunction. This visual glitch breaks immersion and may confuse players or interfere with character interactions.",
  "affected_item": "Character model and physics"
}

{
  "reasoning": "The video shows a player driving a vehicle in a game environment. At one point, an explosion occurs near a soldier on the road, but the soldier's animation and reaction appear unnatural and stiff. Additionally, the explosion effect seems to lack proper impact on the environment and characters, and the soldier's movement after the explosion is abrupt and lacks fluidity, indicating a physics or animation glitch.",
  "bug_report_title": "Unnatural Soldier Animation and Explosion Impact Glitch",
  "bug_report_description": "During vehicle gameplay, an explosion near a soldier triggers an unnatural and stiff animation for the soldier, with abrupt and unrealistic movement post-explosion. The explosion effect itself lacks proper environmental interaction and impact, reducing immersion and potentially confusing players about the explosion's effect on characters and surroundings.",
  "affected_item": "Character animation and explosion physics"
}

{
  "reasoning": "The video shows a player character stuck inside the roof of a truck, with only the head visible above the vehicle's surface. This is not a normal behavior and indicates a collision or clipping issue where the character model is intersecting with the truck's geometry. The character should be fully visible and positioned outside the truck's roof, not partially embedded within it.",
  "bug_report_title": "Character Clipping Inside Truck Roof",
  "bug_report_description": "During gameplay, the player character becomes partially embedded inside the roof of a truck, with only the head visible above the surface. This clipping issue likely results from improper collision detection or physics handling between the character model and the truck. It can confuse players, break immersion, and potentially interfere with gameplay mechanics such as visibility, targeting, or movement.",
  "affected_item": "Character and Vehicle Collision/Physics"
}

{
  "reasoning": "The video shows a character attempting to interact with a door that visually appears closed and solid, but the character is able to pass through it without any collision or interaction. This behavior is inconsistent with expected game physics and collision detection, indicating a glitch. Additionally, the character's shadow and the door's shadow do not align properly, further suggesting rendering or collision issues. Later, the character moves through an environment with some clipping through objects and inconsistent shadow rendering, which may affect immersion and gameplay.",
  "bug_report_title": "Door Collision and Rendering Glitch Allowing Passage Through Closed Door",
  "bug_report_description": "The door in the brick wall appears visually closed and solid, but the player character can pass through it as if it were not there, indicating a collision detection failure. The shadows of the door and character do not align correctly, suggesting rendering inconsistencies. This bug can confuse players and break immersion, potentially allowing unintended access to restricted areas or bypassing game mechanics. Additional minor clipping and shadow rendering issues are observed in the surrounding environment, which may also impact visual fidelity and gameplay experience.",
  "affected_item": "Environment (door collision and rendering), Physics (collision detection), Shadows (rendering)"
}

{
  "reasoning": "The video shows a clear graphical glitch where the rearview mirror inside the vehicle is replaced by a floating, disembodied mouth. This mouth appears to be a texture or model error, as it does not correspond to any normal in-game object and remains in place despite changes in camera angle and character position. The glitch disrupts the visual immersion and may confuse players, as the rearview mirror is an important element for situational awareness while driving.",
  "bug_report_title": "Rearview Mirror Replaced by Floating Mouth Graphic",
  "bug_report_description": "Inside the vehicle, the rearview mirror is visually replaced by a floating mouth that does not belong to any character or object. This graphical anomaly persists through various camera angles and character movements, indicating a rendering or texture mapping error. The issue affects player immersion and could potentially interfere with gameplay by obscuring the rearview mirror's intended function.",
  "affected_item": "Environment (Vehicle Interior - Rearview Mirror)"
}

{
  "reasoning": "The video clip shows a close-up cinematic scene where two characters are about to kiss. The facial animations and lip-syncing appear natural and smooth, with no visible graphical glitches, clipping, or texture issues. The lighting and shadows are consistent, and the characters' movements are fluid and believable. There are no physics anomalies or unexpected behaviors during the interaction.",
  "bug_report_title": "No visual or behavioral glitches detected in cinematic kiss scene",
  "bug_report_description": "The cinematic sequence depicting the kiss between the two characters plays out smoothly without any graphical bugs, clipping, texture pop-ins, or animation issues. The lip-syncing matches the dialogue, and the lighting and shadows are consistent throughout the scene. The characters' movements and expressions appear natural, and there are no physics or rendering anomalies that could impact the player's experience or immersion.",
  "affected_item": "Character animations and cinematic rendering"
}

{
  "reasoning": "The video shows a player character being shot and killed, followed by a killcam replay. The killcam replay exhibits a significant delay in the death animation and ragdoll physics, where the enemy character remains in an unnatural, floating pose for an extended period before collapsing. This behavior is inconsistent with typical death animations and ragdoll physics, indicating a glitch.",
  "bug_report_title": "Killcam Death Animation and Ragdoll Physics Delay",
  "bug_report_description": "During the killcam replay after a player is killed, the enemy character's death animation and ragdoll physics are delayed. The enemy remains suspended in an unnatural pose for several seconds before finally collapsing to the ground. This glitch disrupts the visual flow of the killcam and may confuse players about the timing and impact of kills. It also detracts from the overall immersion and polish of the game experience.",
  "affected_item": "Character animation and physics (ragdoll)"
}

{
  "reasoning": "The helicopter is shown repeatedly colliding with the glass wall of a building, but instead of stopping or crashing normally, it clips through the glass and continues moving inside the building. The helicopter's tail and body pass through the glass without any realistic collision response, indicating a collision detection or physics glitch. Eventually, the helicopter explodes and the player dies, but the initial collision behavior is clearly abnormal.",
  "bug_report_title": "Helicopter clips through glass walls without proper collision",
  "bug_report_description": "When flying near the glass walls of the building, the helicopter does not properly collide with the glass surface. Instead, it clips through the glass, passing inside the building without any realistic collision or stopping effect. This glitch breaks immersion and can confuse players about the physical boundaries of the environment. The helicopter eventually explodes, but the initial clipping through the glass is a clear physics and collision detection bug that affects gameplay realism and may allow unintended access to interior spaces.",
  "affected_item": "Physics and collision detection of helicopter and environment"
}

{
  "reasoning": "The sequence of images shows a player in blue performing a diving header or falling forward in an unnatural manner, which appears to be a physics or animation glitch. The player's body is unnaturally horizontal and parallel to the ground, which is not typical for a realistic fall or header in a soccer game. This suggests a bug in the collision detection or animation blending system.",
  "bug_report_title": "Player Diving Animation Glitch Causes Unnatural Horizontal Fall",
  "bug_report_description": "During gameplay, a player in blue performs a diving header or falls forward, but the animation causes the player to be unnaturally horizontal and parallel to the ground, which looks unrealistic. This glitch likely stems from an issue with the physics or animation system, causing the player's body to clip or float unnaturally. This visual bug can break immersion and may confuse players about the actual game state or collision outcomes.",
  "affected_item": "Character animation and physics"
}

{
  "reasoning": "The video shows a character floating in mid-air above the ground, which is not a natural or intended behavior in the game. Characters are expected to stand on surfaces or move along the ground, so this floating indicates a physics or collision detection glitch.",
  "bug_report_title": "NPC Floating Above Ground Instead of Standing on Surface",
  "bug_report_description": "An NPC character is observed floating several feet above the ground near a train track area. The character does not fall or move down to the ground level, which breaks immersion and could affect gameplay by making the NPC unreachable or uninteractive. This issue likely stems from a physics or collision detection error where the NPC's position is not properly aligned with the environment's surfaces.",
  "affected_item": "Character (NPC) physics and collision"
}

{
  "reasoning": "The NPC character is seen walking on the edge of the roof, which is an unusual and likely unintended behavior for a pedestrian AI. Normally, NPCs should stay on walkable ground or designated paths, not on narrow roof edges. This suggests a pathfinding or AI navigation glitch.",
  "bug_report_title": "NPC Walking on Roof Edge Instead of Ground",
  "bug_report_description": "An NPC character is observed walking along the edge of a roof, which is not a typical or intended path for pedestrian AI. This behavior could confuse players and break immersion, as NPCs are expected to navigate streets and sidewalks rather than rooftops. It may also cause collision or clipping issues if the NPC falls or interacts with the environment unexpectedly.",
  "affected_item": "NPC AI / Pathfinding"
}

{
  "reasoning": "The video shows a sequence where the player character is inside a subway train, and the environment and characters appear normal initially. However, as the video progresses, the player character falls through the floor of the train and ends up outside the train on the tracks, which is an unintended behavior. This indicates a collision detection or physics glitch where the floor geometry is not properly registered, allowing the player to fall through it. This can disrupt gameplay by allowing the player to access areas not meant to be accessible or causing the player to get stuck or die unexpectedly.",
  "bug_report_title": "Player falls through subway train floor due to collision detection glitch",
  "bug_report_description": "During gameplay inside the subway train, the player character unexpectedly falls through the floor of the train and ends up on the train tracks outside. This occurs because the floor collision is not properly detected or rendered, allowing the player to pass through it. This glitch can break immersion, cause the player to get stuck or die, and potentially allow access to unintended areas, impacting gameplay negatively.",
  "affected_item": "Physics and environment collision"
}

{
  "reasoning": "The images show a character model that is unnaturally positioned, floating and intersecting with the bar counter and the seated character in the red dress. The character's limbs are extended in an impossible manner, indicating a physics or animation glitch. This is not a normal pose or interaction within the game environment.",
  "bug_report_title": "Character Model Clipping and Floating Animation Glitch at Bar Counter",
  "bug_report_description": "A character model is seen floating and clipping through the bar counter and another seated character. The limbs of the floating character are unnaturally extended and intersect with the environment and other characters, breaking immersion and potentially causing collision detection issues. This glitch may confuse players and disrupt gameplay, especially in social or interactive scenes.",
  "affected_item": "Character model and physics"
}

{
  "reasoning": "The video shows a character model floating in mid-air without any visible support, which is not a normal behavior for character positioning in the game. Additionally, the dialogue text is cut off and incomplete in several frames, indicating a text rendering or dialogue system bug. The floating character disrupts immersion and may confuse players, while the incomplete text can hinder understanding of the story or instructions.",
  "bug_report_title": "Character Floating Mid-Air and Dialogue Text Clipping",
  "bug_report_description": "During a cutscene or dialogue sequence, one character is seen floating in mid-air without any support or animation to justify this position, which is a clear positioning or physics glitch. Furthermore, the dialogue text box frequently cuts off sentences, showing incomplete lines that make it difficult to follow the conversation. These issues affect the visual presentation and narrative clarity, potentially impacting player experience and immersion.",
  "affected_item": "Character positioning and dialogue text rendering"
}

{
  "reasoning": "The video shows the player character walking through a castle environment with normal visuals initially. However, the character suddenly clips through the floor and falls into an undefined void or empty space with no visible textures or geometry. This indicates a collision detection or level boundary issue, causing the player to fall out of the playable area. The final frames show the pause menu overlaid while the character is still falling, confirming the game is still running but the player is stuck in an unintended area.",
  "bug_report_title": "Player falls through floor and into void due to missing collision or level boundary",
  "bug_report_description": "During normal gameplay, the player character unexpectedly clips through the floor and falls into an invisible void beneath the map. The environment geometry and textures disappear, leaving the player in an empty space with no visual reference. This bug likely results from missing or broken collision detection or level boundaries in this section of the castle environment. It can cause the player to become stuck or require a reload, disrupting gameplay flow and immersion.",
  "affected_item": "Environment collision and level boundaries"
}

{
  "reasoning": "The sequence of images shows a character seemingly attacking another NPC with a weapon, but the NPC's body remains rigid and does not react naturally to the hit. Additionally, the NPC suddenly collapses to the ground in an unnatural manner, with limbs and body parts clipping through the environment. This indicates a physics or animation glitch where the ragdoll or hit reaction system is not functioning correctly.",
  "bug_report_title": "NPC Hit Reaction and Ragdoll Physics Glitch",
  "bug_report_description": "When the player character attacks an NPC with a weapon, the NPC does not exhibit proper hit reaction animations and instead remains stiff. Upon collapsing, the NPC's body clips through the sidewalk and other objects, resulting in unnatural positioning and immersion-breaking visuals. This bug affects the realism of combat encounters and may confuse players about the effectiveness of their attacks.",
  "affected_item": "Character physics and animation"
}

{
  "reasoning": "The character model is seen floating above the water surface without any visible support or swimming animation, which is unnatural. The character's legs are bent and positioned as if walking or running, but the character is suspended in mid-air above the water, indicating a physics or animation glitch. Additionally, the camera angle shifts abruptly underwater and then back above water, showing inconsistent rendering of the water surface and character interaction with it.",
  "bug_report_title": "Character Floating Above Water with Incorrect Animation and Camera Glitch",
  "bug_report_description": "The player character is observed floating above the water surface without proper swimming or walking animation, with legs bent unnaturally as if walking in mid-air. The water surface interaction is inconsistent, with the camera switching between underwater and above water views abruptly. This glitch breaks immersion and may confuse players about the character's state or movement, potentially affecting gameplay mechanics related to swimming or water traversal.",
  "affected_item": "Character physics and animation, camera rendering, water surface interaction"
}

{
  "reasoning": "The NPC standing next to the red pickup truck exhibits unnatural, jerky movements and repeatedly shifts between a neutral stance and a suspicious pose indicated by a question mark above his head. This behavior is inconsistent with normal NPC animations and suggests an animation or AI state glitch.",
  "bug_report_title": "NPC Animation and AI State Glitch Causing Repetitive Suspicious Behavior",
  "bug_report_description": "The NPC near the red pickup truck alternates rapidly between a neutral standing pose and a suspicious pose marked by a question mark above his head. This causes a jerky, unnatural movement loop that breaks immersion and may confuse players about the NPC's intent or alertness. The glitch likely stems from an animation state machine or AI behavior bug, causing the NPC to toggle between states without proper triggers or cooldowns.",
  "affected_item": "NPC animation and AI behavior"
}

{
  "reasoning": "The video shows a basketball game where the court's logo texture is severely distorted and fragmented, appearing as broken and misplaced black patches on the floor. This is not a normal rendering of the court's logo and disrupts the visual consistency of the playing surface. Additionally, the crowd and sideline characters appear to have low-resolution textures and some clipping issues, but the most prominent glitch is the corrupted court logo.",
  "bug_report_title": "Severe Court Logo Texture Corruption and Fragmentation",
  "bug_report_description": "During gameplay, the court's central logo is rendered incorrectly, showing fragmented and misplaced black patches instead of a coherent logo. This graphical glitch breaks immersion and can confuse players about court positioning. The issue persists across multiple camera angles and affects the overall visual quality of the game. While crowd and sideline character models also show minor texture and clipping issues, the primary concern is the corrupted court floor texture.",
  "affected_item": "Environment (court floor texture)"
}

{
  "reasoning": "The character model is seen floating and moving horizontally above the ground in a swimming or flying pose, which is inconsistent with the natural movement expected on solid terrain. This indicates a physics or animation glitch where the character is not properly grounded or interacting with the terrain.",
  "bug_report_title": "Character Floating and Swimming Animation on Ground",
  "bug_report_description": "The player character is displayed in a swimming or flying pose while hovering above the ground instead of walking or running. This visual glitch breaks immersion and may confuse players about the character's state or control. It could also interfere with collision detection and gameplay mechanics related to movement and terrain interaction.",
  "affected_item": "Character physics and animation"
}

{
  "reasoning": "The character is seen climbing or interacting with a door or gate that appears to be a solid, non-climbable object. The character's animation and position suggest an attempt to climb or pass through the door, which is not intended behavior. This is likely a collision or interaction bug where the character can get stuck or perform unintended actions on the door.",
  "bug_report_title": "Character Climbing/Interacting with Non-Climbable Door",
  "bug_report_description": "The player character is able to climb or interact with a door that should be a solid barrier. The character's animation shows climbing or grabbing the door, which is not expected. This could lead to the player getting stuck or bypassing intended gameplay barriers, potentially breaking level progression or immersion.",
  "affected_item": "Character interaction with environment (door collision and climbing mechanics)"
}

{
  "reasoning": "The images show a sequence where two enemy characters are caught in a web and appear to be stuck in an unnatural overlapping position, with their models intersecting and tangled in the webbing. This is visually inconsistent with normal enemy behavior and animation, indicating a physics or collision detection glitch. Additionally, the enemies inside the truck in the last few images appear to be clipping through the truck's walls, which is another clear rendering or collision issue.",
  "bug_report_title": "Enemy models overlapping and clipping through environment during web capture and inside truck",
  "bug_report_description": "During combat, two enemies caught in Spider-Man's web become stuck in an overlapping and intersecting position, with their models visibly tangled and intersecting unnaturally. This visual glitch breaks immersion and may confuse players about enemy status. Furthermore, enemies inside the truck are clipping through the truck's walls, indicating improper collision detection or rendering issues. These bugs affect visual clarity and could impact gameplay by making enemy states unclear or causing unexpected interactions.",
  "affected_item": "Character models and environment collision"
}

{
  "reasoning": "The images show a vehicle that is visibly intersecting with a wall, which is not physically possible in a realistic environment. This indicates a collision detection or physics glitch where the vehicle is clipping through the wall geometry.",
  "bug_report_title": "Vehicle Clipping Through Wall",
  "bug_report_description": "The vehicle is partially embedded inside the wall, indicating a collision detection failure. This visual glitch breaks immersion and could potentially allow players to exploit the environment or get stuck, affecting gameplay flow and player experience.",
  "affected_item": "physics"
}

{
  "reasoning": "The video shows a wrestling match where one character is repeatedly grabbing and throwing another character. The animation appears unnatural and stiff, with characters overlapping in ways that suggest collision detection or physics issues. Additionally, the character on the right side of the ring is stuck outside the ropes, unable to re-enter the ring, indicating a possible clipping or physics bug.",
  "bug_report_title": "Character clipping and physics issues during wrestling moves and ring boundary",
  "bug_report_description": "During the wrestling match, characters exhibit unnatural overlapping and stiff animations when performing grabs and throws, suggesting issues with collision detection or physics simulation. Furthermore, a character is seen stuck outside the ring ropes, unable to re-enter, which may disrupt gameplay flow and player control. These issues can negatively impact the visual quality and player experience by causing immersion-breaking glitches and potential gameplay interruptions.",
  "affected_item": "Character physics and collision detection"
}

{
  "reasoning": "The video shows a character attempting to enter a garage or shuttered door, but the door does not open as expected. Instead, the character is blocked by an invisible collision or the door remains closed despite the interaction prompt. This behavior is inconsistent with normal gameplay where such doors should open to allow passage. The character's movement is hindered, and the door's state does not change, indicating a glitch.",
  "bug_report_title": "Garage Door Interaction Fails to Open, Blocking Player Progression",
  "bug_report_description": "When the player character approaches and attempts to interact with the garage door/shutter, the door fails to open despite the interaction prompt being present. The door remains closed and acts as a solid barrier, preventing the player from progressing through the area. This issue disrupts gameplay flow and may cause player frustration as the expected door-opening mechanic does not function. The problem appears to be related to the door's collision or interaction trigger not activating properly.",
  "affected_item": "Environment (Garage Door/Shutter)"
